import http from "../http-common";

class MunicipioDataService {
  getAll() {
    return http.get("/municipios");
  }

  get(id) {
    return http.get(`/municipios/${id}`);
  }

  findByTitle(nome) {
    return http.get(`/municipios?nome=${nome}`);
  }
}

export default new MunicipioDataService();
